package org.example.Ex3New;public class Car1 {    private String type;    private Priority priority;    public Car1(String type, Priority priority) {        this.type = type;        this.priority = priority;    }    public String getType() {        return type;    }    public void setType(String type) {        this.type = type;    }    public Priority getPriority() {        return priority;    }    public void setPriority(Priority priority) {        this.priority = priority;    }    @Override    public String toString() {        return "Car {" +                "type = '" + type + '\'' +                ", priority = " + priority +                '}';    }}